Dilma (PT) entregou o pré-sal brasileiro para Rothschild e Rockefeller em 2013


No dia 22 de Outubro de 2013, o Governo de esquerda da Dilma Rousseff decidiu vender o maior campo de petróleo do Brasil. Esse campo de petróleo, conhecido como campo de Libra, foi a maior descoberta do pré-sal brasileira. Naquela época, a gente tinha tantas riquezas nesse campo de petróleo que o valor estimado era de 1,5 trilhão de dólares. No entanto, o governo da Dilma (PT) vendeu esse campo por 1,5 bilhão de dólares. Significa que ela vendeu por 0,1% do valor dessa riqueza. Esse pré-sal foi vendido para duas famílias: Rothschild e Rockefeller.
